// App.js
import React from 'react';
import RegistroUsuario from './components/RegistroUsuario';

function App() {
  return (
    <div>
      <h1>Registro y Login de Usuarios</h1>
      <RegistroUsuario />
      <hr />
    </div>
  );
}

export default App;
